import { useState } from "react";
import Layout from "../components/layout/layout";
import Input from "../components/input";
import Button from "../components/button";

function Checkout() {
  const position = { container: "w-2/4 m-auto", button: "*:w-full *:py-4" };
  const design = { separator: "bg-gray-200" };
  const [data, setData] = useState({});

  function onChange(e) {
    const { name, value } = e.target;
    setData((prev) => ({ ...prev, [name]: value }));
  }

  return (
    <Layout>
      <div className={position.container}>
        <div className={position.wrapper}>
          <Title name="Delivery" />
          <Heading name="What's your name and address?" />
          <Input
            name="fname"
            value={data.fname}
            onChange={onChange}
            placeholder="First Name"
          />
          <Input
            name="lname"
            value={data.lname}
            onChange={onChange}
            placeholder="Last Name"
          />
          <Input
            name="address"
            value={data.address}
            onChange={onChange}
            placeholder="Address"
          />
          <Heading name="What's your contact information?" />
          <Input
            name="email"
            value={data.email}
            onChange={onChange}
            placeholder="Email"
          />
          <Input
            name="phone"
            value={data.phone}
            onChange={onChange}
            placeholder="Phone Number"
          />
          <div className={position.button}>
            <Button text="Continue" />
          </div>
          <hr className={design.separator} />
        </div>
      </div>
    </Layout>
  );
}

export default Checkout;

function Title(props) {
  const design = "font-medium text-xl text-gray-900 mb-8";
  return <h3 className={design}>{props.name}</h3>;
}

function Heading(props) {
  const design = "font-medium";
  return <h4 className={design}>{props.name}</h4>;
}
